<body>
	<label for='swc_input'>Upload a swc file to view it in the SharkViewer:</label><input type='file' name='swc_input' id='swc_input' />
	<!-- three.js container -->
    	<div id="container" style='position:relative'></div>
	<!-- info on screen display -->


	<script type='text/javascript'>
	var mdata, adata;
	function readSwcFile(e) {
		var f = e.target.files[0]; 
		console.log(f);
		if (f) {
			var r = new FileReader();
			r.onload = function(e2) { 
				var swc_txt = e2.target.result;
				var swc = swc_parser(swc_txt);
				if ( Object.keys(swc).length > 0 ) {
					//remove previous neuron
					document.getElementById('container').innerHTML = "";

					var s = new SharkViewer({
						swc: swc, 
						dom_element: 'container', 
						center_node: -1, 
						show_stats: true, 
						metadata: mdata
					});
					s.init();
					s.animate();
				}
				else {
					alert("Please upload a valid swc file.");
				}
			}
			r.readAsText(f);
		} else { 
		      alert("Failed to load file");
		}
	}
	window.onload = function() {
		document.getElementById('swc_input').addEventListener('change', readSwcFile, false);
		var swc = swc_parser(document.getElementById("swc").text);
		mdata = JSON.parse(document.getElementById("metadata_swc").text);
		adata = annotation_parser(document.getElementById("annotations").text);
		var s = new SharkViewer({
			swc: swc, 
			mode: 'skeleton',
			dom_element: 'container', 
			center_node: -1, 
			show_stats: true, 
			annotation: adata,
			metadata: mdata});
		s.init();
		s.animate();
	}
	function annotation_parser(txt) {
		var ann_ar = txt.split("\n");
		var ann_json = [];
		var float = '-?\\d*(?:\\.\\d+)?';
		var pattern = new RegExp('^[ \\t]*(' + [
			float,    // x
			float,    // y
			float,    // z
		].join(')[ \\t]+(') + ')[ \\t]*$');
		ann_ar.forEach(function (e) {
			//if line is good, put into json
			var match = e.match(pattern);
			if (match) {
				ann_json.push(
					{
						'x'      : parseFloat(match[0]),
						'y'      : parseFloat(match[1]),
						'z'      : parseFloat(match[2]),
					}
				);
			}
		});
		console.log(ann_json);
		return ann_json;
	}
	</script>
